import React from 'react';
import { Avatar, Card } from 'antd';

const UserProfile = () => {
    return (
        <Card>
            <Card.Meta 
                avatar={<Avatar>SC</Avatar>}
                title="supercoder"
            />
        </Card>
    );
}

export default UserProfile();
